import MainBar from './MainBar';

function Dashboard({ toggleSidebar }) {
    useEffect(() => {
        toggleSidebar();
    }, [toggleSidebar]);

    return (
        <div>
            <MainBar />
        </div>
    );
}

export default Dashboard;
